Now we'll create the query interface that retrieves relevant documents and generates responses. from typing import List, Dict from kamiwaza_client import KamiwazaClient class RAGQuery: def __init__(self, base_url="http://localhost:7777/api/", chat_model_repo="Qwen/Qwen3-0.6B-GGUF"): self.client = KamiwazaClient(base_url=base_url) self.embedding_model = "BAAI/bge-base-en-v1.5" self.chat_model_repo = chat_model_repo self.collection_name = "documents" # Initialize embedder for query processing self.embedder = self.client.embedding.get_embedder( model=self.embedding_model, provider_type="huggingface_embedding" ) # Get OpenAI-compatible client for the deployed chat model try: self.openai_client = self.client.openai.get_client(repo_id=self.chat_model_repo) print(f"✅ RAG Query system initialized with chat model: {self.chat_model_repo}") except Exception as e: print(f"⚠️ Warning: Could not initialize chat model client: {e}") print(f" Make sure the model {self.chat_model_repo} is deployed") self.openai_client = None def semantic_search(self, query: str, limit: int = 5) -> List[Dict]: """Perform semantic search on the document collection.""" print(f"🔍 Searching for: '{query}'") print(f" - Collection: {self.collection_name}") print(f" - Max results: {limit}") # Generate embedding for the query query_embedding = self.embedder.create_embedding(query).embedding # Perform vector search using SDK results = self.client.vectordb.search( query_vector=query_embedding, collection_name=self.collection_name, limit=limit, output_fields=[ "source", "offset", "filename", "model_name", "chunk_text", "chunk_index", "chunk_size", "document_title" ] ) print(f"✅ Found {len(results)} relevant chunks") return results def format_context(self, search_results: List[Dict]) -> str: """Format search results into context for LLM.""" context_parts = [] for result in search_results: # Extract metadata if hasattr(result, 'metadata'): metadata = result.metadata elif isinstance(result, dict) and 'metadata' in result: metadata = result['metadata'] else: metadata = {} # Get chunk text and source info chunk_text = metadata.get('chunk_text', '') filename = metadata.get('filename', 'Unknown') document_title = metadata.get('document_title', filename) if chunk_text: context_parts.append(f"Document: {document_title}
{chunk_text}") return "

".join(context_parts) def generate_response(self, query: str, context: str) -> str: """Generate response using retrieved context and deployed Kamiwaza model.""" if not self.openai_client: return f"[Error: Chat model not available. Please deploy {self.chat_model_repo} first]" prompt = f"""Based on the following context, answer the user's question. If the context doesn't contain enough information to answer the question, say so. Context: {context} Question: {query} Answer:""" try: # Use the deployed Kamiwaza model via OpenAI-compatible interface response = self.openai_client.chat.completions.create( messages=[ {"role": "user", "content": prompt} ], model="model", # Use "model" as the model name for Kamiwaza OpenAI interface max_tokens=500, temperature=0.7, stream=False ) return response.choices[0].message.content except Exception as e: return f"[Error generating response: {str(e)}]" def query(self, user_question: str, limit: int = 5) -> Dict: """Complete RAG query pipeline.""" print(f"🤖 Processing RAG query: {user_question}") # Search for relevant documents search_results = self.semantic_search(user_question, limit=limit) # Format context for LLM context = self.format_context(search_results) # Generate response (you'll need to implement LLM integration) response = self.generate_response(user_question, context) # Prepare sources information sources = [] for result in search_results: metadata = result.metadata if hasattr(result, 'metadata') else result.get('metadata', {}) score = result.score if hasattr(result, 'score') else result.get('score', 0.0) sources.append({ 'filename': metadata.get('filename', 'Unknown'), 'document_title': metadata.get('document_title', ''), 'chunk_index': metadata.get('chunk_index', 0), 'score': score }) return { 'question': user_question, 'answer': response, 'context': context, 'sources': sources, 'num_results': len(search_results) }
